function formatCellWorks(index){
	 //alert("formatCellWorks( Wt: " + WT);
	 //alert("formatCellWorks index: "+index);
//	 alert("sLabOp: "+sLabOp)
	 //sIndex=index;
/*
This field indicates the labor operation if changed by the user.  Valid values are:
-1 = initialization value and unchanged by the user
1 = Remove/Replace
2 = Rem/Ins (Remove / Install)
4 = Align
5 = Overhaul
6 = Refinish
8 = Check/Adjust
9 = Repair
13 = Repair Small (old GE versions)
14 = Repair Average (old GE versions)
15 = Repair Large (old GE versions)
16 = Automatic Repair


    [
        0'Rep Aut',
        1'Rep',
        2'Des/Cam',
        3'Des/Mon',
        4'Rev/Ajus',
        5'Pint',
        6'Re/Ge',
        7'Alinear'
    ]
*/


    switch(index)
    {
    case "16":
      return works[0];
      break;
    case "9":
      return works[1];
      break;
    case "1":
      return works[2];
      break;
    case "2":
      return works[3];
      break;
    case "8":
      return works[4];
      break;
    case "6":
      return works[5];
      break;
    case "5":
      return works[6];
      break;
    case "7":
      return works[7];
      break;
    }    
}
 

 function formatCellMOTypes(index){
 /*

 This field indicates the labor category if changed by the user.  Valid values are:
 -1 = initialization value and unchanged by the user
 0 = Body
 4 = Mechanical
 6 = Refinish
 10 = Glass
 11 = Frame
 12 = Body-Structural 



               [
                 'Carroceria',
                 'Mecanica',
                 'Pintura',
                 'Cristal',
                 'Chasis',
                 'Carroc-Estruc'
               ]
 */

     switch(index)
     {
     case "0":
       return MOTypes[0];
       break;
     case "4":
       return MOTypes[1];
       break;
     case "6":
       return MOTypes[2];
       break;
     case "10":
       return MOTypes[3];
       break;
     case "11":
       return MOTypes[4];
       break;
     case "12":
       return MOTypes[5];
       break;
     }    
 }

